import React from "react";

import MidleContentStyle from "./MidleContentStyle"

//import {MidleContentConsumer} from "../../../../providers/MidleContextProvider"

import {Conxtext,ListActiveConsumer} from "../../../../ListActiveContextProvider"

class MidleContent extends React.PureComponent {
    constructor(props) {
        super(props);
        this.state = {
          error: null,
          isLoaded: false,
        };
      }

      static contextType = Conxtext

      _showCard = (context) =>
      {
          let object = this.context.ListActive.find(item => item.isSelected === true)

          console.log("this._showCard(context)",this.context.ListActive)

          if(object === undefined)
          {
            return <h3>MidleContent</h3>
          }

          return <h3>{object.name}</h3>
      }

      render() {
        return (
            <MidleContentStyle>
              <ListActiveConsumer>
                  { context =>(
                    this._showCard(context)
                )}
              </ListActiveConsumer>
            </MidleContentStyle>
        )
      }
}


export default MidleContent;

